import { Button } from 'react-bootstrap';
import api from '../../../services/api';
import './index.css';
 
interface ITask{
    id: number;
    nome: string;
    ra: string;
    dataNasc: Date;
    idade: number;
    Matriculado: boolean;
}
 
const Tasks: React.FC = () => {
 
    return (
        
        <div className="container">
            <br />
            <div className="task-header">
                <h1>Novo Cadastro</h1>
                <Button variant="dark" size="sm">Voltar</Button>
            </div>
            <br />
        </div>
    );
}
 
export default Tasks;
